import React, { PureComponent } from "react";
import PropTypes from "prop-types";
import './Login.css'

export default class SignUp extends PureComponent {
  static propTypes = {
    
  };
  
  constructor(props)
  {
	super(props);
	this.state = {
		password1: '',
		password2: '',
		name: '',
		message:''
	}
  }
  
  
  onClick = event  =>
  {
	  //do login logic from server,
	  console.log(this.state.password)
	  console.log(this.state.name)
	  //this.props.history.push("/");
  };
  
  render() {
    return (
       <div >
          <div className='component-login' style={{display: "flex", flexDirection: "column",
            position: 'absolute', left: '25%', top: '30%',
            width: '50%'
          }}>
            <label>Name</label>
            <input type="text" placeholder="Name" onChange={evt => this.updateNameValue(evt)} name='name' />
            <label>Password</label>
            <input type="text" placeholder="Password" onChange={evt => this.updatePassword1Value(evt)} name='password1' />
			<label>ReType Password</label>
			<input type="text" placeholder="Password" onChange={evt => this.updatePassword2Value(evt)} name='password2' />
			<div className="component-signup-retype"> {this.state.message} </div>
            <div className="component-login-button" onClick={this.onClick} >
			SignUp
		   </div>
          </div>
        </div>
    );
  }
  
  updateNameValue(evt) {
    this.setState({
      name: evt.target.value
    });
  }
  
  updatePassword1Value(evt) {
    this.setState({
      password1: evt.target.value
    });
  }
  updatePassword2Value(evt) {
    this.setState({
      password2: evt.target.value
    });
  }
}
